# https://leetcode-cn.com/problems/second-minimum-time-to-reach-destination

from collections import defaultdict

def secondMinimum(n: int, edges, time: int, change: int) -> int:
    edge_map = defaultdict(set)
    for i, j in edges:
        edge_map[i].add(j)
        edge_map[j].add(i)
    
    bfs = [[-1, -1] for _ in range(n + 1)]
    bfs[1] = [0, -1]
    queue = [1]
    next_queue = set()
    step = 1
    while queue:
        i = queue.pop()
        flag = True  # 如果所有相连节点的最短和次短都找到了，该节点就可以从遍历中删除了
        for j in edge_map[i]:
            if bfs[j][0] == -1:  # 如果最短路径还没走到，则更新最短路径
                bfs[j][0] = step
                flag = False
            elif bfs[j][1] == -1 and step != bfs[j][0]:
                # 如果最短路径走到了，但次短路径还没走到，则更新次短路径
                # 还要加第二个条件避免在同一层多次走到同一节点，会使得最短路径=次短路径
                bfs[j][1] = step
                flag = False
            next_queue.add(j)
        if flag: del edge_map[i]

        if not queue:
            queue = list(next_queue)
            next_queue = set()
            step += 1

            # 终点的次短路径走到了
            if bfs[n][1] != -1:
                break
    
    # 把步数还原为时间
    tot_time = 0
    for _ in range(bfs[n][1]):
        if tot_time // change % 2 == 1:
            tot_time = (tot_time // change + 1) * change
        tot_time += time

    return tot_time


